import React , { Component } from 'react';
import { NavLink } from 'react-router-dom';
import '../assets/Navigation.css';

class Navigation extends Component {
    render() {
        const active = {
            'color' : '#3dc4c4'
        }
        return (
            <div className="navBar">
                <ul className="navigation">
                <li><NavLink to="/" activeStyle={active}>HOME</NavLink></li>
                <li><NavLink to="./blog" activeStyle={active}>BLOG</NavLink></li>
                <li><NavLink to="./portfolio" activeStyle={active}>PORTFOLIO</NavLink></li>
                <li><NavLink to="./posts" activeStyle={active}>POSTS</NavLink></li>
                </ul>
            </div>
        )
    } 
}

export default Navigation;
